import { Button, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";
import backgroundImage from './background.avif';

function AddInventories() {
    const navigation = useNavigate();

    const handleNavigation = () => {
        navigation('/AddProducts');
    }

    const handleAddInventory = () => {
        const container = document.querySelector('.inventory-container');
        if (container) {
            const newInput = document.createElement('div');
            newInput.innerHTML = `
                <div>
                    <label>ENTER THE INVENTORY NAME:</label>
                    <input placeholder="INVENTORY NAME" type='text' />
                </div>
            `;
            container.appendChild(newInput);
        }
    }

    return (
        <Box sx={{
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            backgroundImage: `url(${backgroundImage})`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            minWidth: '800px',
        }}>
            <Box sx={{
                display: 'flex',
                justifyContent: 'center',
                fontFamily: 'Times New Roman, Times, serif',
                fontSize: 'x-large',
                marginLeft: '-90px'
            }}>
                <h2>HERE YOU CAN ADD THE SHOPS</h2>
            </Box>
            <Box sx={{
                display: 'flex',
                width: '600px',
                flexDirection: 'column',
                justifyContent: 'center',
                flex: 1,
                marginTop: -20,
            }}>
                <Box sx={{
                    display: 'flex',
                    flexDirection: 'row',
                }}>
                    <Box sx={{
                        display: 'flex',
                        flex: 1,
                        alignItems: 'center',
                        fontFamily: 'timesnewroman',
                        fontSize: '18px',
                        maxWidth: '300px'
                    }}>
                        <label>ENTER THE SHOP NAME:</label>
                    </Box>
                    <Box sx={{
                        display: 'flex',
                        flex: 1,
                        alignItems: 'center',
                    }}>
                        <input placeholder="SHOP NAME" type='text' />
                    </Box>
                </Box>
                <Box sx={{
                    display: 'flex',
                    flexDirection: 'row',
                }}>
                    <Box sx={{
                        display: 'flex',
                        flex: 1,
                        alignItems: 'center',
                        fontFamily: 'timesnewroman',
                        fontSize: '18px',
                        maxWidth: '300px'
                    }}>
                        <label>ENTER THE INVENTORY NAME:</label>
                    </Box>
                    <Box sx={{
                        display: 'flex',
                        flex: 1,
                        alignItems: 'center',
                    }}>
                        <input placeholder="INVENTORY NAME" type='text' />
                    </Box>
                    <Box sx={{
                        display: 'flex',
                        borderRadius: '20px',
                        marginLeft: '-70px',
                        height: '25px'
                    }}>
                        <Button onClick={handleAddInventory} variant="contained">ADD</Button>
                    </Box>
                </Box>
                <Box sx={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    minHeight: '10vh',
                }}>
                    <Button onClick={handleNavigation} variant="contained">ADD INVENTORIES</Button>
                </Box>
            </Box>
        </Box>
    );
}

export default AddInventories;
